        (901, 356, null, null, 10, null, 1, 'BIRD', 1000000, 'NO-CAGED31', null, 72300, '{"type": "BIRD", "subName": "Chim không lông", "quantity": 1, "subPrice": 1000000.0, "originName": "Amazon", "subBirdAge": 1, "productName": "Chim không lông", "birdAgegroup": "NESTLING", "birdTypeName": "Khác", "subBirdColor": "Skin", "birdHasSerial": true, "subBirdIsMale": true, "birdBundleType": "BATCH", "birdTypeNameEn": "Khác", "orderItemPrice": 1000000.0, "subDescription": "Là con chim hong có lông", "subBirdMutation": "Trụi lông độc lạ", "productMediaList": {"mediaJsonObjects": [{"mediaKeys": "7b57d4ec-d9d5-4242-9118-e8a93c49522e", "mediaType": "image/webp"}]}, "subCagePicketNum": 0, "birdTypeSizeGroup": "VERY_LARGE", "productDescription": "Là con chim hong có lông", "subProductMediaList": {"mediaJsonObjects": [{"mediaKeys": "7b57d4ec-d9d5-4242-9118-e8a93c49522e", "mediaType": "image/webp"}]}, "subBirdIsDomesticated": true}'),
        (902, 356, null, null, null, 2, 1, 'ACCESSORY', 130000, 'PACKAGE-O', null, 23800, '{"type": "ACCESSORY", "quantity": 1, "subPrice": 130000.0, "subBirdAge": 0, "productName": "Hộp đựng thức ăn cho chim có dây treo chống thấm nước tiện dụng", "orderItemPrice": 130000.0, "productMediaList": {"mediaJsonObjects": [{"mediaKeys": "3123bcf4-d318-4132-b6b0-2da639458e80", "mediaType": "image/jpeg"}]}, "subCagePicketNum": 0, "productDescription": "Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\n\nThể tích: 700ml\n \n Màu sắc: Nâu/ xanh lá/ xám\n \nGói hàng bao gồm: 1 Hộp đựng thức ăn cho chim\nChất liệu: PS+ABS cao cấp\n \n Kích thước: Như chương trình hình ảnh\n \n Đặc trưng:\n \n Hộp đựng thức ăn cho chim: Sản phẩm có dây buộc kim loại dây thép, vì vậy bạn có thể treo an toàn bất cứ nơi nào chim có thể với tới. Hộp đựng thức ăn cho chim sẽ thu hút rất nhiều loài chim và bạn có được niềm vui đến từ việc xem chim ăn.\n \n \n \n Phù hợp với: Đây là những con chim ăn bằng chứng sóc, giống chim hoang dã cho thức ăn bên ngoài. Mở nắp, đặt hạt cho chim hoang dã và hạt hướng dương cho chim vào dụng cụ, đóng nắp, sau đó treo hộp đựng dưới mái hiên hoặc trong vườn.\n \n  \n \n Công suất lớn: Giữ tới 40 oz thức ăn. Các cổng cho ăn có khoảng cách tốt, có thể cho ăn nhiều con chim cùng một lúc. Khi hạt được ăn, nhiều hạt khác sẽ lấp đầy khay. Các khay có các lỗ rỉ để tránh tích tụ nước và giữ cho thực phẩm khô.\n \n  \n \n Thiết kế thuận tiện: Thiết kế hình tròn tuyệt vời có mái nghiêng che bóng râm từ mặt trời và mưa. Sản phẩm nhựa giúp bạn biết khi nào nên nạp lại thức ăn. Chất lượng cao, tuyệt vời cho sử dụng lâu dài.\n \n \n \n Dịch vụ sau bán hàng: Chúng tôi đã cam kết cung cấp cho khách hàng các sản phẩm và dịch vụ chất lượng tốt nhất, vì vậy bạn có thể chọn sản phẩm mà không do dự. Chúng tôi tin rằng bạn sẽ thích sản phẩm này. Nếu bạn không hài lòng với các sản phẩm của chúng tôi, chúng tôi sẽ giải quyết cho bạn. Nếu bạn có bất kỳ câu hỏi về thức ăn cho chim, xin vui lòng liên hệ với chúng tôi.\n \n \n \n \n \n Lưu ý: 1. Màu sắc thực của sản phẩm có thể hơi khác so với các hình ảnh được hiển thị trên trang web gây ra bởi nhiều yếu tố như độ sáng của màn hình và độ sáng ánh sáng của bạn.\n \n 2. Xin vui lòng cho phép độ lệch đo thủ công nhẹ cho dữ liệu kích thước.", "productPackageWidth": 3.0, "productPackageHeight": 4.0, "productPackageLength": 2.0}'),
