        (904, 357, null, 16, null, null, 1, 'FOOD', 18000, 'PACKAGE-O', null, 26200, '{"type": "FOOD", "subName": "Loại đặc biệt", "foodType": "NUTS", "quantity": 1, "subPrice": 18000.0, "subWeight": 400.0, "originName": "Việt Nam", "subBirdAge": 0, "productName": "Ngũ cốc cho chim Cu Gáy đặc biệt Anh Đức", "birdTypeName": "Chim Cu Gáy", "birdTypeNameEn": "Turtle Dove", "orderItemPrice": 18000.0, "foodSpecialties": "Khoẻ Mạnh, Mượt Lông, ", "chargeableWeight": 400.0, "productMediaList": {"mediaJsonObjects": [{"mediaKeys": "c383294b-3acb-4bd2-bc0f-e7290874c209", "mediaType": "image/jpeg"}]}, "subCagePicketNum": 0, "birdTypeSizeGroup": "MEDIUM", "productDescription": "Ngũ cốc cho chim Cu Gáy, Vẹt, Yến Phụng đặc biệt Anh Đức ...,Thức ăn cho chim Yến Phụng, chim Vẹt, chim Cu Gáy LOVECHIM\n\nThành phần: gồm khoáng chất và 12 loại hạt dành cho chim cu gáy.\ncông dụng: cung cấp đầy đủ chất dinh dưỡng và vitamin giúp chim khỏe, đẹp, lông mỏ bóng mượt.\n.\n.\nCách chăm sóc chim cũng là một yếu tố ảnh hưởng không nhỏ đến chất lượng của 1 con chim. Trong đó ngũ cốc cho  chim cũng chiếm một tỉ lệ nhất định.\n.\n Ai cũng muốn tìm cho những chú chim của mình những thứ  tốt nhất ở trên thị trường, ai cũng muốn những loại ngũ cốc  đó sẽ giúp chú chim của mình đầy đủ được dinh dưỡng và căng lửa. \n.\nVi vậy Ngũ cốc đặc biệt LOVECHIM cho chim cu gáy,vẹt... sẽ là lựa chọn rất tốt cho chú chim của các bạn.\n#ngucocchochim #ngucocchogay #ngucocchovet #ngucoc #thucanchochimcanh #thucanchochim #chimvet #vet #thucanchochimyenphung #thucanchochimvet #thucanchovet #thucancugay", "productPackageWidth": 3.0, "subProductMediaList": {"mediaJsonObjects": [{"mediaKeys": "0b2efa46-6792-4aa9-90a9-5bcf7ad8b1e0", "mediaType": "image/jpeg"}]}, "productPackageHeight": 20.0, "productPackageLength": 15.0}'),
